import React, {useState} from "react";

const Calendar = () => {
    const [date, setDate] = useState(new Date());
    const onChange = date => {
        setDate(date);
    };

    return <div>
        <Calendar onChange={onChange}
        value = {date}/>
    </div>

};

export default Calendar;
